import React from "react";
import {useDispatch, useSelector} from 'react-redux'
import { useEffect } from "react";
import { getId } from '../action/index'
import { useParams } from 'react-router-dom'
import {Link} from 'react-router-dom';
import './styles/Detail.css'


export default function Detail(props){
    const dispatch = useDispatch()
    // eslint-disable-next-line no-unused-vars

    let dog = useSelector((state) => state.detail)
    
    const {id} = useParams()

    useEffect(() => {
        dispatch(getId(id))
    }, [dispatch, id])
return(
<div className="Detail">
{
    dog? 
    <div className="cardDetail">
            <img src={dog.image} alt="" className="imgDetail"/>

        <div className="contentDetail">
            <div className="titleDetail">
                <h1>{dog.name}</h1>
            </div>
            <div className="textDetail">
                <p>weight: {dog.weight}</p>
                <p>height: {dog.height}</p>
                <p>life span: {dog.life_span}</p>
                <p className={styles.text}> Temperaments: {!dog[0].createdInDb? myDog[0].temperament + " " : myDog[0].temperaments.map(el => el.name + (" "))}</p>
            </div>
            <div >
                <Link to={'/home'} className="btnDetail">To home</Link>
            </div>
        </div>
        
        
    </div>
    : <h2>Loading</h2>
}


</div>
)

}
